import React from 'react';
import './App.css';
import Body from './Body';
import Header from './Header';
import logo from '../src/logo.svg';
import { ola, myName, about, bemVindo /* welcome, */ /* bemVindo */ } from './bodyContent';
import Typewriter from 'typewriter-effect';

const App = () => {
  console.log(Object.props.chidren.bemVindo);
  return (
    <div className="App">
      <Header>
        <Typewriter
          onInit={(typewriter) => {
            typewriter
            .typeString(`${bemVindo}`)
            .pauseFor(2000)
            .deleteAll()
            .typeString('welcome')
            .start();
          }} />
      </Header>
      <div className="container">
        <div className="body-container">
          <Body>{ ola }</Body>
          <Body>{ myName }</Body>
          <Body>{ about }</Body>
        </div>
        <img src={logo} alt="logo" className="App-logo" />
      </div>
    </div>
  );
}

export default App;
